//Create result table out of input stream/table
val result_table =  spark.sql("select * from query")

//Check query status
query.isActive

//see the query records and record count
result_table.count()
result_table.show()

//Derive features to train the ML model with
val featureCols = Array("lat", "lon")

//Add features to result table to be consumed by the ML model
val assembler = new VectorAssembler().setInputCols(featureCols).setOutputCol("features")
val table_with_features = assembler.transform(result_table)

//See the transformed table
table_with_features.show()

//Split data in train and test set
val Array(trainingData, testData) = table_with_features.randomSplit(Array(0.7, 0.3), 1000)

//Create ML model with 1 iteration. On bigger clusters can be set to a bigger number
val kmeans = new KMeans().setK(5).setFeaturesCol("features").setMaxIter(1)

//Train the model
val model = kmeans.fit(trainingData)

//Print the cluster centers learned by the model on training dataset
println("Learned Centers: ")
model.clusterCenters.foreach(println)

//Do prediction on test dataset
val prediction_df = model.transform(testData)
prediction_df.show

//Register prediction table for further analysis on predicted results
prediction_df.registerTempTable("prediction_table")

//Prepare data to be plot on map
val predictions =sqlContext.sql("SELECT lat,lon,prediction FROM prediction_table")

//Create binding with the angular code
z.angularBind("locations", predictions.collect())

%angular
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.css" />
<div id="map" style="height: 800px; width: 100%"></div>

<script type="text/javascript">
function initMap() {
    var map = L.map('map').setView([30.00, -30.00], 3);

    L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Map data &copy; <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
        maxZoom: 30,
        minZoom: 3
    }).addTo(map);

    var geoMarkers = L.layerGroup().addTo(map);

    var el = angular.element($('#map').parent('.ng-scope'));
    angular.element(el).ready(function() {
        window.locationWatcher = el.scope().compiledScope.$watch('locations', function(newValue, oldValue) {
            angular.forEach(newValue, function(event) {
                var marker = L.marker([ event.values[0], event.values[1] ])
                  .bindPopup("cluster: "+event.values[2]+", location: ("+ event.values[0]+","+ event.values[1]+")")
                  .addTo(geoMarkers);
            });
        })
    });
}

if (window.locationWatcher) {

    // clear existing watcher otherwise we'll have duplicates
    window.locationWatcher();
}

// ensure we only load the script once
if (window.L) {
    initMap();
} else {
    console.log('Loading Leaflet library');
    var sc = document.createElement('script');
    sc.type = 'text/javascript';
    sc.src = 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.5/leaflet.js';
    sc.onload = initMap;
    sc.onerror = function(err) { alert(err); }
    document.getElementsByTagName('head')[0].appendChild(sc);
}
</script>
